#ifdef _WIN32
#include <windows.h>
#endif // _WIN32

#include <GL/gl.h>

#include <ErrorManager.h>
#include <MyGLH.h>

#include "MySoldier.h"

using namespace std;

/**
*/
CMySoldier::CMySoldier(void)
{
	Create();
}

/**
*/
CMySoldier::~CMySoldier(void)
{
}

/**
*/
bool CMySoldier::Initialize(void)
{
	if (!InitializeMesh())
	{
		MarkError();

		return false;
	}

	if (!InitializeTexture())
	{
		MarkError();

		return false;
	}

	return true;
}

/**
*/
void CMySoldier::LoadDrawState(void)
{
	glColor3f(1.0f, 1.0f, 1.0f);

	glAlphaFunc(GL_GREATER, 0.05f);

	glEnable(GL_ALPHA_TEST);

	glBlendFunc(GL_SRC_ALPHA, GL_ONE_MINUS_SRC_ALPHA);

	//glEnable(GL_BLEND);
}

/**
*/
void CMySoldier::UnloadDrawState(void)
{
	//glDisable(GL_BLEND);

	glDisable(GL_ALPHA_TEST);
}

/**
*/
void CMySoldier::Draw(void) 
{
	LoadDrawState();

	m_texture->Bind(0);

	m_mesh->Draw();

	CTexture::DisableTextureUnit(0);

	UnloadDrawState();
}

/**
*/
boost::shared_ptr<CVertexPool> CMySoldier::GetMesh(void)
{
	return m_mesh;
}

/**
*/
boost::shared_ptr<CTexture> CMySoldier::GetTexture(void)
{
	return m_texture;
}

/**
*/
bool CMySoldier::IsValid(void) 
{
	if (m_texture.get())
		if (m_texture->IsValid())
			if (m_mesh.get())
				if (m_mesh->IsValid())
					return true;

	return false;
}

/**
*/
bool CMySoldier::InitializeMesh(void)
{
	m_mesh.reset(new CVertexPool);

	if (!m_mesh.get())
	{
		MarkError();

		return false;
	}

	m_mesh->AddTexCoord(0.0f, 0.0f);
	m_mesh->AddTexCoord(1.0f, 0.0f);
	m_mesh->AddTexCoord(0.32f, 0.6f);
	m_mesh->AddTexCoord(0.68f, 0.6f);
	m_mesh->AddTexCoord(0.0f, 0.0f);
	m_mesh->AddTexCoord(1.0f, 0.0f);
	m_mesh->AddTexCoord(0.0f, 1.0f);
	m_mesh->AddTexCoord(1.0f, 1.0f);

	m_mesh->AddVertex(-0.25000f, 0.000000f, 0.000000);
	m_mesh->AddVertex(0.250000f, 0.000000f, 0.000000);
	m_mesh->AddVertex(-0.06250f, 0.531250f, 0.000000);
	m_mesh->AddVertex(0.062500f, 0.531250f, 0.000000);
	m_mesh->AddVertex(-0.25000f, 0.000000f, 0.000000);
	m_mesh->AddVertex(0.250000f, 0.000000f, 0.000000);
	m_mesh->AddVertex(-0.25000f, 1.000000f, 0.000000);
	m_mesh->AddVertex(0.250000f, 1.000000f, 0.000000);

	m_mesh->AddTriangle(0, 1, 3);
	m_mesh->AddTriangle(0, 3, 2);
	m_mesh->AddTriangle(2, 3, 7);
	m_mesh->AddTriangle(2, 7, 6);
	m_mesh->AddTriangle(2, 6, 4);
	m_mesh->AddTriangle(3, 5, 7);

	if (!m_mesh->IsValid())
	{
		MarkError();

		return false;
	}

	return true;
}

